import React from "react";

export function Model(data) {
  data.map((item) => {
    return (
      <div>
        {data.map((name, nb_place, index) => {
          return (
            <li key={index}>
              {name} {nb_place}
            </li>
          );
        })}
      </div>
    );
  });
}
